Named functions in Feo are defined using the func keyword. func greet(name) { println("Hello, " + name + "!")
} Functions in Feo are first class values and can be assigned to variables, passed to functions, or anything else you might do with any other data type. // This function takes a function as an argument
func twice(f, x) { f(f(x))
} func add_one(x) x + 1 func add_two(x) twice(add_one, x)

