match expression is the only control flow in Feo. name := "Nobu"
match name { "Nobu" -> println("Cool name!"), "Sol" -> println("Nice name."), "Damian" -> println("Eh, nice, I guess?"), _ -> println("Hello, " + name),
} But there is also a short-hand match, which is known as the ternary operator. damian_stinks := false
command := damian_stinks ? "go take a shower" : "go take a nap" // de-sugars to this:
command = match damian_stinks { true -> "go take a shower", _ -> "go take a nap",
}

